import Cover from '../images/cover.jpg'
import '../Styles/Dashboard.css'
export default function Dashboard(){
    return(
        <div>
            <div className='cover'>
                <img src={Cover} alt='cover-image' className='cover-image'/>
            </div>
        </div>
    )
}
